import React from 'react'
import './Personal.css'
import { forwardRef } from 'react'
const Personal=forwardRef((props,ref)=> {
  return (
    <div ref={ref} className='skill-container'>
      <div className='box1'>
        <h1>
          Skills & Technologies
        </h1>
        <p>My drive to always learn new and different technologies had me trying a plethora of them.The following skills are the ones that I've found myself coming back to time and time again in order to fullfil the different tasks that i had on my hand.  </p>
      </div>

    </div>
  )
});

export default Personal;
